function GenerateTempCode() {
    var Type = "BMS_BOOKING";

    var res = BOOKING_IBC.Gentempcode(Type);
    var ds = res.value;
    if (ds == null) {
        alert(res.error.description);
        return false;
    }
    document.getElementById('hdnbookno').value = ds.Tables[0].Rows[0].TEMP_CODE;
}
