//************************************************************************Prime from  Time to time  bind************************************************************************
function Bindrosfromtime(event) {
    var key = event.keyCode ? event.keyCode : event.which;
    if (key == 113 && document.activeElement.id == "txtrosfrom") {
        document.getElementById("divrosfrom").style.display = "block";
        aTag = eval(document.getElementById("txtrosfrom"))
        var btag;
        var leftpos = 0;
        var toppos = 0;
        do {
            aTag = eval(aTag.offsetParent);
            leftpos += aTag.offsetLeft;
            toppos += aTag.offsetTop;
            btag = eval(aTag)
        } while (aTag.tagName != "BODY" && aTag.tagName != "HTML");
        var tot = document.getElementById('divrosfrom').scrollLeft;
        var scrolltop = document.getElementById('divrosfrom').scrollTop;
        document.getElementById('divrosfrom').style.left = document.getElementById("txtrosfrom").offsetLeft + leftpos - tot + "px";
        document.getElementById('divrosfrom').style.top = document.getElementById("txtrosfrom").offsetTop + toppos - scrolltop + "px"; //"510px";
        if (document.getElementById('hdnprime').value == "") {
            alert("Please Select Prime Time");
            document.getElementById('rodptype').focus();
            return false;
        }
        var pcomp_code = document.getElementById('hdncompcode').value;
        var pfrom = document.getElementById('txtrosfrom').value.toUpperCase();
        var ptimecode = document.getElementById('hdnprime').value.toUpperCase();
        var pextra = "F";
        BOOKING_IBC.Bindfromprime(pcomp_code, pfrom, ptimecode, pextra, Bindrosfromtime_callback);
    }

    else if ((key == 8) || (key == 46)) {
        if (document.activeElement.id == "txtrosfrom") {
            document.getElementById('txtrosfrom').value = "";
        }
    }
    else if (key == 27) {
        document.getElementById("divrosfrom").style.display = "none";
        document.getElementById('txtrosfrom').focus();
        return false;
    }
    else if (key == 13) {
        if (document.getElementById("divrosfrom").style.display == "block") {
            Fillrosfromtime(event);
            return false;
        }
        if (document.activeElement.id == "istrosfrome") {
            Fillrosfromtime(event);
            return false;
        }
        document.getElementById("divrosfrom").style.display = "none";
        return false;
    }
    else if (key == 38) {
        if (document.getElementById("divrosfrom").style.display == "block") {
            if (document.getElementById('istrosfrome').value == '0') {
                document.getElementById('txtrosfrom').focus();
            }
        }
    }

    else if (key == 9) {
        document.getElementById("divrosfrom").style.display = "none";
        //        document.getElementById('txtnProgType').focus();
        //        return false;
    }

    else if (key == 40) {
        if (document.getElementById("divrosfrom").style.display == "block") {
            document.getElementById("istrosfrome").focus();
        }
    }

    else {
        document.getElementById("divrosfrom").style.display = "block";
        aTag = eval(document.getElementById("txtrosfrom"))
        var btag;
        var leftpos = 0;
        var toppos = 20;
        do {
            aTag = eval(aTag.offsetParent);
            leftpos += aTag.offsetLeft;
            toppos += aTag.offsetTop;
            btag = eval(aTag)
        } while (aTag.tagName != "BODY" && aTag.tagName != "HTML");
        var tot = document.getElementById('divrosfrom').scrollLeft;
        var scrolltop = document.getElementById('divrosfrom').scrollTop;
        document.getElementById('divrosfrom').style.left = document.getElementById("txtrosfrom").offsetLeft + leftpos - tot + "px";
        document.getElementById('divrosfrom').style.top = document.getElementById("txtrosfrom").offsetTop + toppos - scrolltop + "px"; //"510px";
        if (document.getElementById('hdnprime').value == "") {
            alert("Please Select Prime Time");
            document.getElementById('rodptype').focus();
            return false;
        }
        var pcomp_code = document.getElementById('hdncompcode').value;
        var pfrom = document.getElementById('txtrosfrom').value.toUpperCase();
        var ptimecode = document.getElementById('hdnprime').value.toUpperCase();
        var pextra = "F";
        BOOKING_IBC.Bindfromprime(pcomp_code, pfrom, ptimecode, pextra, Bindrosfromtime_callback);

    }
}

function Bindrosfromtime_callback(response) {
    var ds = response.value;
    var lstitem = document.getElementById("istrosfrome");
    lstitem.options.length = 0;
    lstitem.options[0] = new Option("-------- Select ROS From Time.---------", "0");
    if (ds != null && ds.Tables[0].Rows.length > 0) {

        for (var i = 0; i < ds.Tables[0].Rows.length; ++i) {
            lstitem.options[lstitem.options.length] = new Option(ds.Tables[0].Rows[i].FROM_TIME, ds.Tables[0].Rows[i].TO_TIME);
        }
    }

    document.getElementById('Txtrosto').value = "";
    document.getElementById("istrosfrome").selectedIndex = 1;
    return false;
}

function Fillrosfromtime(event) {
    var key = event.keyCode ? event.keyCode : event.which;

    if (key == 27) {
        if (document.activeElement.id == "txtrosfrom" || document.activeElement.id == "istrosfrome") {
            document.getElementById("divrosfrom").style.display = "none";
            document.getElementById('txtrosfrom').focus();
            return false;
        }
    }
    if (key == 13 || event.type == "click") {

        if (document.getElementById("istrosfrome").value == "0") {
            // alert("Please Select From Time");
            return false;
        }
        else {
            document.getElementById("divrosfrom").style.display = "none";
            var lstvalue = document.getElementById('istrosfrome').value;
            for (var k = 0; k < document.getElementById("istrosfrome").length; k++) {
                if (document.getElementById('istrosfrome').options[k].value == lstvalue) {
                    // document.getElementById('txttotime').value = document.getElementById('istrosfrome').options[k].value;
                    if (browser != "Microsoft Internet Explorer")
                        document.getElementById('txtrosfrom').value = document.getElementById('istrosfrome').options[k].textContent;
                    else
                        document.getElementById('txtrosfrom').value = document.getElementById('istrosfrome').options[k].innerText;

                    break;
                }
            }
        }
        document.getElementById('txtrosfrom').focus();
        return false;
    }
}
