function ArrowUpDownKey(event) {
    var key = event.keyCode ? event.keyCode : event.which;
    if (key == 40) {
        var activeid = document.activeElement.id;
        var id = activeid.split("_");
        if (document.getElementById(id[0] + "_" + (parseInt(id[1]) + 1)) != null) {
            document.getElementById(id[0] + "_" + (parseInt(id[1]) + 1)).focus();
        }
        return true;
    }
    if (key == 38) {
        var activeid = document.activeElement.id;
        var id = activeid.split("_");
        if (document.getElementById(id[0] + "_" + (parseInt(id[1]) - 1)) != null) {
            document.getElementById(id[0] + "_" + (parseInt(id[1]) - 1)).focus();
        }
        return true;
    }
    if (key == 39) {
        if (browser != "Microsoft Internet Explorer") {
            event.which = 9;
            return event.which;
            return true;
        }
        else {
            event.keyCode = 9;
            return event.keyCode;
            return true;
        }
    }
   
    if (key == 37) {
        if (browser != "Microsoft Internet Explorer") {
            if (event.shiftKey == true) {
                event.which = 9;
                return event.which;
            }
            return true;
        }
        else {
            if (event.shiftKey == true) {
                event.keyCode = 9;
                return event.keyCode;
            }
            return true;
        }
    }
}


