function ArrowUpDownKey2(event) {
    var key = event.keyCode ? event.keyCode : event.which;
    if (key == 40) {
        var activeid = document.activeElement.id;
        var id = activeid.split("_");
        if (document.getElementById(id[0] + "_" + (parseInt(id[1]) + 1)) != null) {
            document.getElementById(id[0] + "_" + (parseInt(id[1]) + 1)).focus();
        }
        return true;
    }
    if (key == 38) {
        var activeid = document.activeElement.id;
        var id = activeid.split("_");
        if (document.getElementById(id[0] + "_" + (parseInt(id[1]) - 1)) != null) {
            document.getElementById(id[0] + "_" + (parseInt(id[1]) - 1)).focus();
        }
        return true;
    }
    if (key == 39) {
        if (browser != "Microsoft Internet Explorer") {
            event.which = 9;
            return event.which;
            return true;
        }
        else {
            event.keyCode = 9;
            return event.keyCode;
            return true;
        }
    }
    if (key == 13) {
        var flag = "N";

        var activeid = document.activeElement.id;
        var rd = parseInt(activeid.split('_')[1]);
        var Gridlength = (document.getElementById('tbchkgfdivGrid1').rows.length - 1);
        for (var k = rd; k < Gridlength; k++) {
            for (var k1 = 1; k1 < 32; k1++) {
                if (document.activeElement.id == "chkdayg" + k1 + "_" + k) {
                    for (var k2 = (k1 + 1) ; k2 < 32; k2++) {
                        flag = "Y";
                        if (document.getElementById("chkdayg" + k2 + "_" + k).disabled == false) {
                            document.getElementById("chkdayg" + k2 + "_" + k).focus();
                            return false;
                        }
                        if (k2 > 28) {
                            if (Gridlength > (k + 1)) {
                                document.getElementById("chkdayg1_" + (k + 1)).focus();
                                return false;
                            }
                        }
                        k1++;

                    }


                    if (flag == "N") {
                        if (Gridlength > (k + 1)) {
                            document.getElementById("chkdayg1_" + (k + 1)).focus();
                            return false;
                        }
                    }
                }
            }
        }
    }
    if (key == 37) {
        if (browser != "Microsoft Internet Explorer") {
            if (event.shiftKey == true) {
                event.which = 9;
                return event.which;
            }
            return true;
        }
        else {
            if (event.shiftKey == true) {
                event.keyCode = 9;
                return event.keyCode;
            }
            return true;
        }
    }
}

