function bindgrtotime2_callback(response) {
    var ds = response.value;
    var lstitem = document.getElementById("istgrrosto3");
    lstitem.options.length = 0;
    lstitem.options[0] = new Option("---- Select From Time ----", "0");
    if (ds != null && ds.Tables[0].Rows.length > 0) {
        for (var i = 0; i < ds.Tables[0].Rows.length; ++i) {
            lstitem.options[lstitem.options.length] = new Option(ds.Tables[0].Rows[i].TO_TIME, ds.Tables[0].Rows[i].TO_TIME);
        }
    }
    else {
        lstitem.options.length = 0;
        document.getElementById("divgrrosto3").style.display = "none";
    }
    document.getElementById("istgrrosto3").selectedIndex = 1;
    return false;
}

function fillgrtoacc3(event) {

    var id = activeac.split("_");
    var key = event.keyCode ? event.keyCode : event.which;
    if (key == 9) {

        document.getElementById("chkEndTime3_" + id[1]).focus();

    }
    else if (key == 13 || event.type == "click") {
        if (document.getElementById("istgrrosto3").value == "0") {
            alert("Please Select From Time");
            return false;
        }
        else {
            document.getElementById("divgrrosto3").style.display = "none";
            var lstvalue = document.getElementById('istgrrosto3').value;
            for (var k = 0; k < document.getElementById("istgrrosto3").length; k++) {
                if (document.getElementById('istgrrosto3').options[k].value == lstvalue) {
                    var code = document.getElementById('istgrrosto3').options[k].value;
                    code = code.split("$");
                    document.getElementById("chkEndTime3_" + id[1]).value = code[0];
                    if (browser != "Microsoft Internet Explorer")
                        document.getElementById("chkEndTime3_" + id[1]).value = document.getElementById('istgrrosto3').options[k].textContent;
                    else
                        document.getElementById("chkEndTime3_" + id[1]).value = document.getElementById('istgrrosto3').options[k].innerText;
                    break;


                }
            }
        }


        return false;
    }

    if (key == "27") {
        document.getElementById("divgrrosto3").style.display = "none";
        document.getElementById("chkEndTime3_" + id[1]).focus();
    }

}


