function getrostotime8(event) {
    var key = event.keyCode ? event.keyCode : event.which;
    activeac = document.activeElement.id;
    var id = activeac.split("_");


    var pcomp_code = document.getElementById('hdncompcode').value;
    var pfrom = document.getElementById("chkEndTime8_" + id[1]).value.toUpperCase();
    var ptimecode = document.getElementById("chkprimcode8_" + id[1]).value.toUpperCase();
    var pextra = "";


    if (key == 8 || key == 46) {
        document.getElementById("divgrrosto8").style.display = "none";
        document.getElementById("chkEndTime8_" + id[1]).value = "";

    }
    else if (key == 27 || key == 16 || key == 17 || key == 18 || key == 20 || key == 91 || key == 33 || key == 34 || key == 35 || key == 36 || key == 112 || key == 114 || key == 115 || key == 116 || key == 117 || key == 118 || key == 119 || key == 120 || key == 121 || key == 122 || key == 123) {
        document.getElementById("divgrrosto8").style.display = "none";
        document.getElementById('chkEndTime8_' + id[1]).focus();
        return false;
    }
    else if (key == 9) {
        document.getElementById("chkEndTime8_" + id[1]).focus();
        document.getElementById("divgrrosto8").style.display = "none";
        return false;
    }
    else if (key == 13) {
        if (document.activeElement.id == "istgrrosto8") {

            fillgrtoacc8(event);
            return false;
        }
        //enterToTab(event);
    }
    else if (key == 40 && document.getElementById("divgrrosto8").style.display == "block") {
        document.getElementById("istgrrosto8").focus();
    }
    else if (document.getElementById("divgrrosto8").style.display == "block" && key == 38) {
        if (document.getElementById('istgrrosto8').value == '0') {
            document.getElementById('chkEndTime8_' + id[1]).focus();
        }
    }
    else if (document.activeElement.id == 'chkEndTime8_' + id[1]) {
        document.getElementById("divgrrosto8").style.display = "block";
        aTag = eval(document.getElementById("chkEndTime8_" + id[1]))
        var btag;
        var leftpos = 0;
        var toppos = 0;
        do {
            aTag = eval(aTag.offsetParent);
            leftpos += aTag.offsetLeft;
            toppos += aTag.offsetTop;
            btag = eval(aTag)
        } while (aTag.tagName != "BODY" && aTag.tagName != "HTML");
        var tot = document.getElementById('divgrrosto8').scrollLeft;
        var scrolltop = document.getElementById('divgrrosto8').scrollTop;
        document.getElementById('divgrrosto8').style.left = document.getElementById("chkEndTime8_" + id[1]).offsetLeft + leftpos - tot + "px";
        document.getElementById('divgrrosto8').style.top = document.getElementById("chkEndTime8_" + id[1]).offsetTop + toppos + 18 - scrolltop + "px"; //"510px";
        BOOKING_IBC.Bindfromprime(pcomp_code, pfrom, ptimecode, pextra, bindgrtotime8_callback);
    }
}

