function TotimeChk8(resid) {
    var id = parseInt(resid.split("_")[1]);
    var pfromtime = document.getElementById("chkFromTime8_" + id).value

    var res = BOOKING_IBC.binttomtimr(pfromtime, "30", "", "");
    if (res == null) {
        alert(res.error.description);
        return false;
    }
    var ds = res.value;

    if (ds.Tables[0].Rows.length > 0) {
        document.getElementById("chkEndTime8_" + id).value = ds.Tables[0].Rows[0].TO_TIME;

    }

    var Gridlength = (document.getElementById('tbchkgfdivGrid8').rows.length - 1);
    for (var k = 0; k < Gridlength; k++) {
        if (document.getElementById("chkFromTime8_" + k).value == "") {
            document.getElementById("chkFromTime8_" + k).value = document.getElementById("chk8FromTime8_" + k).value;
        }
        if (document.getElementById("chkEndTime8_" + k).value == "") {
            document.getElementById("chkEndTime8_" + k).value = document.getElementById("chk8EndTime8_" + k).value;
        }
        if (parseInt(id) != parseInt(k)) {
            if ((document.getElementById("chkFromTime8_" + id).value == document.getElementById("chkFromTime8_" + k).value) && (document.getElementById("chkEndTime8_" + id).value == document.getElementById("chkEndTime8_" + k).value)) {

                document.getElementById("chkFromTime8_" + k).value = document.getElementById("chk8FromTime8_" + id).value;
                document.getElementById("chkEndTime8_" + k).value = document.getElementById("chk8EndTime8_" + id).value;
            }
        }

    }

    document.getElementById("chk8FromTime8_" + id).value = document.getElementById("chkFromTime8_" + id).value;
    document.getElementById("chk8EndTime8_" + id).value = document.getElementById("chkEndTime8_" + id).value;


    changchkgrid8 = "Y";
    return false;
}

