function getrostotime9(event) {
    var key = event.keyCode ? event.keyCode : event.which;
    activeac = document.activeElement.id;
    var id = activeac.split("_");


    var pcomp_code = document.getElementById('hdncompcode').value;
    var pfrom = document.getElementById("chkEndTime9_" + id[1]).value.toUpperCase();
    var ptimecode = document.getElementById("chkprimcode9_" + id[1]).value.toUpperCase();
    var pextra = "";


    if (key == 8 || key == 46) {
        document.getElementById("divgrrosto9").style.display = "none";
        document.getElementById("chkEndTime9_" + id[1]).value = "";

    }
    else if (key == 27 || key == 16 || key == 17 || key == 18 || key == 20 || key == 91 || key == 33 || key == 34 || key == 35 || key == 36 || key == 112 || key == 114 || key == 115 || key == 116 || key == 117 || key == 118 || key == 119 || key == 120 || key == 121 || key == 122 || key == 123) {
        document.getElementById("divgrrosto9").style.display = "none";
        document.getElementById('chkEndTime9_' + id[1]).focus();
        return false;
    }
    else if (key == 9) {
        document.getElementById("chkEndTime9_" + id[1]).focus();
        document.getElementById("divgrrosto9").style.display = "none";
        return false;
    }
    else if (key == 13) {
        if (document.activeElement.id == "istgrrosto9") {

            fillgrtoacc9(event);
            return false;
        }
        //enterToTab(event);
    }
    else if (key == 40 && document.getElementById("divgrrosto9").style.display == "block") {
        document.getElementById("istgrrosto9").focus();
    }
    else if (document.getElementById("divgrrosto9").style.display == "block" && key == 38) {
        if (document.getElementById('istgrrosto9').value == '0') {
            document.getElementById('chkEndTime9_' + id[1]).focus();
        }
    }
    else if (document.activeElement.id == 'chkEndTime9_' + id[1]) {
        document.getElementById("divgrrosto9").style.display = "block";
        aTag = eval(document.getElementById("chkEndTime9_" + id[1]))
        var btag;
        var leftpos = 0;
        var toppos = 0;
        do {
            aTag = eval(aTag.offsetParent);
            leftpos += aTag.offsetLeft;
            toppos += aTag.offsetTop;
            btag = eval(aTag)
        } while (aTag.tagName != "BODY" && aTag.tagName != "HTML");
        var tot = document.getElementById('divgrrosto9').scrollLeft;
        var scrolltop = document.getElementById('divgrrosto9').scrollTop;
        document.getElementById('divgrrosto9').style.left = document.getElementById("chkEndTime9_" + id[1]).offsetLeft + leftpos - tot + "px";
        document.getElementById('divgrrosto9').style.top = document.getElementById("chkEndTime9_" + id[1]).offsetTop + toppos + 18 - scrolltop + "px"; //"510px";
        BOOKING_IBC.Bindfromprime(pcomp_code, pfrom, ptimecode, pextra, bindgrtotime9_callback);
    }
}

