function getRosfromname10(event) {
    var key = event.keyCode ? event.keyCode : event.which;
    activeac = document.activeElement.id;
    var id = activeac.split("_");


    var pcomp_code = document.getElementById('hdncompcode').value;
    var pfrom = document.getElementById("chkFromTime10_" + id[1]).value.toUpperCase();
    var ptimecode = document.getElementById("chkprimcode10_" + id[1]).value.toUpperCase();
    var pextra = "F";


    if (key == 8 || key == 46) {
        document.getElementById("divgrrosfrom10").style.display = "none";
        document.getElementById("chkFromTime10_" + id[1]).value = "";

    }
    else if (key == 27 || key == 16 || key == 17 || key == 18 || key == 20 || key == 91 || key == 33 || key == 34 || key == 35 || key == 36 || key == 112 || key == 114 || key == 115 || key == 116 || key == 117 || key == 118 || key == 119 || key == 120 || key == 121 || key == 122 || key == 123) {
        document.getElementById("divgrrosfrom10").style.display = "none";
        document.getElementById('chkFromTime10_' + id[1]).focus();
        return false;
    }
    else if (key == 9) {
        document.getElementById("chkEndTime10_" + id[1]).focus();
        document.getElementById("divgrrosfrom10").style.display = "none";
        return false;
    }
    else if (key == 13) {
        if (document.activeElement.id == "istgrrosfrome10") {

            fillgrfromacc10(event);
            return false;
        }
        //enterToTab(event);
    }
    else if (key == 40 && document.getElementById("divgrrosfrom10").style.display == "block") {
        document.getElementById("istgrrosfrome10").focus();
    }
    else if (document.getElementById("divgrrosfrom10").style.display == "block" && key == 38) {
        if (document.getElementById('istgrrosfrome10').value == '0') {
            document.getElementById('chkFromTime10_' + id[1]).focus();
        }
    }
    else if (event.ctrlKey == false) {
        if (document.activeElement.id == 'chkFromTime10_' + id[1]) {


            document.getElementById("divgrrosfrom10").style.display = "block";

            aTag = eval(document.getElementById("chkFromTime10_" + id[1]))
            var btag;
            var leftpos = 0;
            var toppos = 0;
            do {
                aTag = eval(aTag.offsetParent);
                leftpos += aTag.offsetLeft;
                toppos += aTag.offsetTop;
                btag = eval(aTag)
            } while (aTag.tagName != "BODY" && aTag.tagName != "HTML");
            var tot = document.getElementById('divgrrosfrom10').scrollLeft;
            var scrolltop = document.getElementById('divgrrosfrom10').scrollTop;
            document.getElementById('divgrrosfrom10').style.left = document.getElementById("chkFromTime10_" + id[1]).offsetLeft + leftpos - tot + "px";
            document.getElementById('divgrrosfrom10').style.top = document.getElementById("chkFromTime10_" + id[1]).offsetTop + toppos + 18 - scrolltop + "px"; //"510px";
            BOOKING_IBC.Bindfromprime(pcomp_code, pfrom, ptimecode, pextra, bindgrfromtime10_callback);
        }

    }

}

function bindgrfromtime10_callback(response) {
    var ds = response.value;
    var id = activeac.split("_");
    var lstitem = document.getElementById("istgrrosfrome10");
    lstitem.options.length = 0;
    lstitem.options[0] = new Option("---- Select From Time ----", "0");
    if (ds != null && ds.Tables[0].Rows.length > 0) {
        for (var i = 0; i < ds.Tables[0].Rows.length; ++i) {
            lstitem.options[lstitem.options.length] = new Option(ds.Tables[0].Rows[i].FROM_TIME, ds.Tables[0].Rows[i].FROM_TIME + "@" + ds.Tables[0].Rows[i].TO_TIME);
        }
        document.getElementById("istgrrosfrome10").selectedIndex = 1;
    }

    else {
        lstitem.options.length = 0;
        document.getElementById("divgrrosfrom10").style.display = "none";
    }

    return false;
}

function fillgrfromacc10(event) {

    var id = activeac.split("_");
    var key = event.keyCode ? event.keyCode : event.which;
    if (key == 9) {

        document.getElementById("chkEndTime10_" + id[1]).focus();

    }
    else if (key == 13 || event.type == "click") {
        if (document.getElementById("istgrrosfrome10").value == "0") {
            alert("Please Select From Time");
            return false;
        }
        else {
            document.getElementById("divgrrosfrom10").style.display = "none";
            var lstvalue = document.getElementById('istgrrosfrome10').value;
            for (var k = 0; k < document.getElementById("istgrrosfrome10").length; k++) {
                if (document.getElementById('istgrrosfrome10').options[k].value == lstvalue) {
                    var code = document.getElementById('istgrrosfrome10').options[k].value;
                    code = code.split("@");
                    document.getElementById("chkFromTime10_" + id[1]).value = code[0];
                    document.getElementById("chkEndTime10_" + id[1]).value = code[1];
                    if (browser != "Microsoft Internet Explorer")
                        document.getElementById("chkFromTime10_" + id[1]).value = document.getElementById('istgrrosfrome10').options[k].textContent;
                    else
                        document.getElementById("chkFromTime10_" + id[1]).value = document.getElementById('istgrrosfrome10').options[k].innerText;
                    break;


                }
            }
        }


        return false;
    }

    if (key == "27") {
        document.getElementById("divgrrosfrom10").style.display = "none";
        document.getElementById("chkFromTime10_" + id[1]).focus();
    }

}



