function bindgrtotime10_callback(response) {
    var ds = response.value;
    var lstitem = document.getElementById("istgrrosto10");
    lstitem.options.length = 0;
    lstitem.options[0] = new Option("---- Select From Time ----", "0");
    if (ds != null && ds.Tables[0].Rows.length > 0) {
        for (var i = 0; i < ds.Tables[0].Rows.length; ++i) {
            lstitem.options[lstitem.options.length] = new Option(ds.Tables[0].Rows[i].TO_TIME, ds.Tables[0].Rows[i].TO_TIME);
        }
    }
    else {
        lstitem.options.length = 0;
        document.getElementById("divgrrosto10").style.display = "none";
    }
    document.getElementById("istgrrosto10").selectedIndex = 1;
    return false;
}

function fillgrtoacc10(event) {

    var id = activeac.split("_");
    var key = event.keyCode ? event.keyCode : event.which;
    if (key == 9) {

        document.getElementById("chkEndTime10_" + id[1]).focus();

    }
    else if (key == 13 || event.type == "click") {
        if (document.getElementById("istgrrosto10").value == "0") {
            alert("Please Select From Time");
            return false;
        }
        else {
            document.getElementById("divgrrosto10").style.display = "none";
            var lstvalue = document.getElementById('istgrrosto10').value;
            for (var k = 0; k < document.getElementById("istgrrosto10").length; k++) {
                if (document.getElementById('istgrrosto10').options[k].value == lstvalue) {
                    var code = document.getElementById('istgrrosto10').options[k].value;
                    code = code.split("$");
                    document.getElementById("chkEndTime10_" + id[1]).value = code[0];
                    if (browser != "Microsoft Internet Explorer")
                        document.getElementById("chkEndTime10_" + id[1]).value = document.getElementById('istgrrosto10').options[k].textContent;
                    else
                        document.getElementById("chkEndTime10_" + id[1]).value = document.getElementById('istgrrosto10').options[k].innerText;
                    break;


                }
            }
        }


        return false;
    }

    if (key == "27") {
        document.getElementById("divgrrosto10").style.display = "none";
        document.getElementById("chkEndTime10_" + id[1]).focus();
    }

}


function TotimeChk10(resid) {
    var id = parseInt(resid.split("_")[1]);
    var pfromtime = document.getElementById("chkFromTime10_" + id).value

    var res = BOOKING_IBC.binttomtimr(pfromtime, "30", "", "");
    if (res == null) {
        alert(res.error.description);
        return false;
    }
    var ds = res.value;

    if (ds.Tables[0].Rows.length > 0) {
        document.getElementById("chkEndTime10_" + id).value = ds.Tables[0].Rows[0].TO_TIME;

    }

    var Gridlength = (document.getElementById('tbchkgfdivGrid10').rows.length - 1);
    for (var k = 0; k < Gridlength; k++) {
        if (parseInt(id) != parseInt(k)) {
            if ((document.getElementById("chkFromTime10_" + id).value == document.getElementById("chkFromTime10_" + k).value) && (document.getElementById("chkEndTime10_" + id).value == document.getElementById("chkEndTime10_" + k).value)) {

                document.getElementById("chkFromTime10_" + k).value = document.getElementById("chk10FromTime10_" + id).value;
                document.getElementById("chkEndTime10_" + k).value = document.getElementById("chk10EndTime10_" + id).value;
            }
        }

    }

    document.getElementById("chk10FromTime10_" + id).value = document.getElementById("chkFromTime10_" + id).value;
    document.getElementById("chk10EndTime10_" + id).value = document.getElementById("chkEndTime10_" + id).value;


    changchkgrid10= "Y";
    return false;
}


